当店オリジナルサイクルLupinus“ルピナス”6段ギア自転車カスタマイズ用パーツです♪<BR>
初期装備でついているサドルとグリップのお色変更をうけたまわっております！<BR>
<BR>
<BR>
■カラー：ブラック<BR>
■適応車種：Lupinus（ルピナス）ブランド、【LP-266TD LP-266TA LP-266UD LP-266UA LP-276TD LP-276TA】商品名をご確認下さいませ。<BR>
■カスタム用パーツとなりますので単品購入はできかねます。ルピナス自転車と同時にご注文下さいませ。<BR>
（ご注文がルピナス自転車と分かれて2件となります際には、ご連絡を頂けますようお願いいたします。）<BR>
<BR>


<font color="#ff0000">※沖縄・離島は別途船運賃がかかります。<BR>
※初期装備のお色と同じお色をご選択頂きました場合や、適応車種以外の自転車とご注文を頂きました場合には、カスタム用パーツのご注文をキャンセルさせて頂きます。<BR>
※地域により、代引き決済がご利用できない場合がございます。<BR>
</font><style type="text/css">
